{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/nickkrikota/google-data-analytics-bellabeat-case-study-in-r?scriptVersionId=160173237\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"3ac1f41e","metadata":{"papermill":{"duration":0.009781,"end_time":"2024-01-23T20:26:01.997332","exception":false,"start_time":"2024-01-23T20:26:01.987551","status":"completed"},"tags":[]},"source":["# INTRODUCTION\n","\n","In this case study, I will be analyzing data for Bellabeat – a company that manufactures high-tech health focused products for women. Although already a successful company, Bellabeat wants to grow its market share in the global smart device market. The co-founder and Chief Creative Officer Urska Srsen believes that analyzing data from the smart fitness devices could unlock new opportunities for growth. For this case study, I will take on the role of a junior data analyst tasked with analyzing the data and presenting the results of my analysis to the executive team. My recommendations will be used for the company’s marketing strategy.\n","\n","# BUSINESS TASK\n","\n","Discover trends in smart device usage to advise the Bellabeat marketing analytics team on potential avenues for growth.\n","\n","# DATA\n","\n","The data used for this case study is gathered through a survey of Fitbit users and is uploaded to Kaggle by user Mobius. It is a part of the public domain. The data has been gathered from March to May of 2016. The fact that the data is somewhat outdated and contains a rather low number of respondents could potentially be problematic when it comes to drawing meaningful conclusions. In this situation I would request fuller and more current data from the stakeholders and potentially use additional proxy data, but for the purpose of this case study I will proceed with the current dataset. \n","\n"]},{"cell_type":"markdown","id":"6b944347","metadata":{"papermill":{"duration":0.006676,"end_time":"2024-01-23T20:26:02.010929","exception":false,"start_time":"2024-01-23T20:26:02.004253","status":"completed"},"tags":[]},"source":["# ANALYSIS\n","\n","Lets begin by importing the datasets used in this analysis as well as the necessary libraries. The three datasets I will be using will contain information on daily activity, daily sleeping time and the weight of the respondents."]},{"cell_type":"code","execution_count":1,"id":"a567d906","metadata":{"execution":{"iopub.execute_input":"2024-01-23T20:26:02.030431Z","iopub.status.busy":"2024-01-23T20:26:02.027894Z","iopub.status.idle":"2024-01-23T20:26:03.434354Z","shell.execute_reply":"2024-01-23T20:26:03.432301Z"},"papermill":{"duration":1.418939,"end_time":"2024-01-23T20:26:03.436927","exception":false,"start_time":"2024-01-23T20:26:02.017988","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘dplyr’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    filter, lag\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    intersect, setdiff, setequal, union\n","\n","\n","── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.1     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.1.8\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u0