d.\n","\n","The sleep dataset contains the time spent in bed as well as the time asleep. It would be interesting to explore the cause for this difference.\n","\n","Finally, the weight dataset contains information on the users’ weight in kilograms as well as their BMI (Body Mass Index).\n"]},{"cell_type":"code","execution_count":5,"id":"88494832","metadata":{"execution":{"iopub.execute_input":"2024-01-23T20:26:03.750025Z","iopub.status.busy":"2024-01-23T20:26:03.748331Z","iopub.status.idle":"2024-01-23T20:26:03.864415Z","shell.execute_reply":"2024-01-23T20:26:03.86222Z"},"papermill":{"duration":0.129254,"end_time":"2024-01-23T20:26:03.867264","exception":false,"start_time":"2024-01-23T20:26:03.73801","status":"completed"},"tags":[]},"outputs":[],"source":["#A good starting point to discover trends among the users and to get more familiar with their fitness levels is to explore their BMIs\n","\n","bmi_categories <- weight %>% \n","  group_by(Id) %>% \n","  summarise(MeanBMI = mean(BMI)) %>%\n","  mutate(\n","    BMICategory = factor(case_when(\n","      MeanBMI >= 18.5 & MeanBMI < 25  ~ \"Normal Weight\",\n","      MeanBMI >= 25 & MeanBMI < 30 ~ \"Overweight\",\n","      MeanBMI >= 30 ~ \"Obese\"))) %>%\n","  drop_na()"]},{"cell_type":"markdown","id":"12efe38e","metadata":{"papermill":{"duration":0.008563,"end_time":"2024-01-23T20:26:03.884007","exception":false,"start_time":"2024-01-23T20:26:03.875444","status":"completed"},"tags":[]},"source":["I have created a new dataset to categorize the users by their BMI."]},{"cell_type":"code","execution_count":6,"id":"535fdb84","metadata":{"execution":{"iopub.execute_input":"2024-01-23T20:26:03.904711Z","iopub.status.busy":"2024-01-23T20:26:03.903174Z","iopub.status.idle":"2024-01-23T20:26:04.580332Z","shell.execute_reply":"2024-01-23T20:26:04.578583Z"},"papermill":{"duration":0.691496,"end_time":"2024-01-23T20:26:04.583717","exception":false,"start_time":"2024-01-23T20:26:03.892221","status":"completed"},"tags":[]},"outputs"