"},"tags":[]},"outputs":[],"source":["active_vs_sedentary <- activity_daily %>%\n","  group_by(Id) %>% \n","  summarize(\n","    MeanSedentaryMinutes = mean(SedentaryMinutes),\n","    MeanVeryActiveMinutes = mean(VeryActiveMinutes),\n","    MeanFairlyActiveMinutes = mean(FairlyActiveMinutes),\n","    MeanLightlyActiveMinutes = mean(LightlyActiveMinutes)) %>%\n","  mutate(\n","    MeanActiveMinutes = (MeanVeryActiveMinutes + \n","                        MeanFairlyActiveMinutes + \n","                        MeanLightlyActiveMinutes)) %>%\n","  drop_na()"]},{"cell_type":"code","execution_count":8,"id":"f418a8d8","metadata":{"execution":{"iopub.execute_input":"2024-01-23T20:26:04.674267Z","iopub.status.busy":"2024-01-23T20:26:04.67268Z","iopub.status.idle":"2024-01-23T20:26:04.69789Z","shell.execute_reply":"2024-01-23T20:26:04.696072Z"},"papermill":{"duration":0.039051,"end_time":"2024-01-23T20:26:04.700887","exception":false,"start_time":"2024-01-23T20:26:04.661836","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["   Min. 1st Qu.  Median    Mean 3rd Qu.    Max. \n","  662.3   766.4  1077.5   999.2  1206.6  1317.4 "]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["   Min. 1st Qu.  Median    Mean 3rd Qu.    Max. \n","  40.68  170.16  244.68  225.09  286.56  341.15 "]},"metadata":{},"output_type":"display_data"}],"source":["#Now I can look at the average time spent in an active state versus a sedentary state\n","\n","summary(active_vs_sedentary$MeanSedentaryMinutes)\n","summary(active_vs_sedentary$MeanActiveMinutes)"]},{"cell_type":"markdown","id":"dd3658c0","metadata":{"papermill":{"duration":0.009003,"end_time":"2024-01-23T20:26:04.71922","exception":false,"start_time":"2024-01-23T20:26:04.710217","status":"completed"},"tags":[]},"source":["The average fitbit user spends about 225 minutes (or around 3.75 hours) a day being active. That is a fairly high amount and it shows that smart fitness device users are successfully motivated to lead healthy and active lifestyles. \n","\n","Finally I would like to take a look at the relationship between activity level, calories burned and time asleep. To do that, I would need to merge the daily activity and the daily sleep datasets. But before I do that, I need to make sure that the date fields follow the same format."]},{"cell_type":"code","execution_count":9,"id":"527a4d82","metadata":{"execution":{"iopub.execute_input":"2024-01-23T20:26:04.741155Z","iopub.status.busy":"2024-01-23T20:26:04.739592Z","iopub.status.idle":"2024-01-23T20:26:04.770032Z","shell.execute_reply":"2024-01-23T20:26:04.768207Z"},"papermill":{"duration":0.051863,"end_time":"2024-01-23T20:26:04.780068","exception":false,"start_time":"2024-01-23T20:26:04.728205","status":"completed"},"tags":[]},"outputs":[],"source":["activity_daily$ActivityDate=as.POSIXct(activity_daily$ActivityDate, format=\"%m/%d/%Y\")\n","activity_daily = rename(activity_daily, Date = ActivityDate)\n","sleep_daily$SleepDay=as.POSIXct(sleep_daily$SleepDay, format=\"%m/%d/%Y\")\n","sleep_daily = rename(sleep_daily, Date = SleepDay)"]},{"cell_type":"code","execution_count":10,"id":"79891e48","metadata":{"execution":{"iopub.execute_input":"2024-01-23T20:26:04.802206Z","iopub.status.busy":"2024-01-23T20:26:04.800634Z","iopub.status.idle":"2024-01-23T20:26:04.827424Z","shell.execute_reply":"2024-01-23T20:26:04.825475Z"},"papermill":{"duration":0.04122,"end_time":"2024-01-23T20:26:04.830262","exception":false,"start_time":"2024-01-23T20:26:04.789042","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":[" POSIXct[1:413], format: \"2016-04-12\" \"2016-04-13\" \"2016-04-15\" \"2016-04-16\" \"2016-04-17\" ...\n"," POSIXct[1:940], format: \"2016-04-12\" \"2016-04-13\" \"2016-04-14\" \"2016-04-15\" \"2016-04-16\" ...\n"]}],"source":["str(sleep_daily$Date)\n","str(activity_daily$Date)"]},{"cell_type":"code","execution_count":11,"id":"95ff52ef","metadata":{"execution":{"iopub.execute_input