ness. The range of Bellabeat products can be your own assistant and personal trainer. It has never been easier to keep track of daily exercise and health information. With each day the progress you make will motivate you to keep going and be your best, healthiest self.*\n","\n","2**. Highlight Bellabeat’s utility as a sleep wellness tool.**\n","\n","The average user in the dataset had trouble falling asleep. With all of the recent interest in improving sleep quality this aspect of the Bellabeat suite should be advertised. As there is some correlation between activity and sedentary levels on sleep length, certain metrics gathered by either product can be used to make recommendations or bring the user’s attention to something that needs to be changed or improved.\n","\n","*Getting a good night sleep is one of the most important aspects of staying healthy, having the energy to conquer the day and simply feeling good. The Bellabeat app and products can help you get deep restful sleep your body needs. Personal recommendations tailored to you will unravel this mystery and be your own personal guide to great sleep.*  "]},{"cell_type":"markdown","id":"c8f6f9fa","metadata":{"papermill":{"duration":0.018005,"end_time":"2024-01-23T20:26:08.461549","exception":false,"start_time":"2024-01-23T20:26:08.443544","status":"completed"},"tags":[]},"source":["# CONCLUSION\n","\n","Thank you for reading! As a beginner data analyst I appreciate any feedback."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1041311,"sourceId":1752235,"sourceType":"datasetVersion"}],"dockerImageVersionId":30433,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":10.434939,"end_time":"2024-01-23T20:26:0